var $bm_rt;
var crmn, offset, tdfMax;
var parentLayer = comp(thisLayer.source._name).layer(3);
var contrLayer = thisComp.layer('White Cat [Controller]');
var prm = 0;
if (contrLayer.marker.numKeys > 0) {
    $bm_rt = prm = contrLayer.marker.nearestKey(time).index;
    if (contrLayer.marker.key(prm).time > time) {
        prm--;
    }
}
if (prm == 0) {
    $bm_rt = 0;
} else {
    var mrrc = contrLayer.marker.key(prm);
    var mn = mrrc.comment;
    var tdf = $bm_sub($bm_sub(time, mrrc.time), $bm_sub(thisLayer.inPoint, contrLayer.inPoint));
    crmn = parentLayer.marker.key(mn);
    if (parentLayer.marker.numKeys > crmn.index) {
        offset = $bm_sub(timeToFrames(parentLayer.marker.key($bm_sum(crmn.index, 1)).time), 1);
        tdfMax = $bm_sub(framesToTime(offset), crmn.time);
    } else {
        tdfMax = $bm_sub(parentLayer.outPoint, crmn.time);
    }
    $bm_rt = tdf = Math.min(tdf, tdfMax);
    if (tdf > 0) {
        $bm_rt = $bm_sum(crmn.time, tdf);
    } else {
        $bm_rt = crmn.time;
    }
}

